import React, {Component} from 'react';
import Plant from "./Plant";
import {Row} from 'react-bootstrap';

export class PlantGroup extends React.Component {
    constructor(props) {
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }

    render() {
        let plants = [];
        for (let i = 0; i < 4; i++) {
            plants.push(<Plant/>);
        }
        return (
            // <div>
            //     {plants}
            // </div>
            <Row>
                {plants}
            </Row>
        )
    }
}
